import Information from "./Components/Information";
import Counter from "./Components/Counter";
import Addition from "./Components/Addition";
import Location from "./Components/Location";

function App() {
  return (
    <div className="App">
      <Information/>
      <Counter/>
      <Addition/>
      <Location/>
    </div>
  );
}

export default App;
